  - STM32F429VGTx
  cores:
  - name: main
    type: armv7em
    core_access_options: !Arm
      ap: !v1 0
  memory_map:
  - !Nvm
    name: BANK_1
    range:
      start: 0x8000000
      end: 0x8100000
    cores:
    - main
    access:
      write: false
      boot: true
  - !Ram
    name: CCMRAM
    range:
      start: 0x10000000
      end: 0x10010000
    cores:
    - main
    access:
      execute: false
  - !Ram
    name: SRAM
    range:
      start: 0x20000000
      end: 0x20030000
    cores:
    - main
  flash_algorithms:
  - stm32f4xx_1024
  - stm32f4xx_1024dual
  - stm32f42xxx_43xxx_opt
  - stm32f4xx_otp
